import './CardEquipoEjemplo.css'
function CardEquipoEjemplo(props) {
    const {nombre,puesto,foto,equipo}=props.registro;
    const {fondoHeader}=props.colorHeader;
    return (
        <article className="card">
            <div className="card__header" style={{backgroundColor:fondoHeader}}>
                <img src={foto} alt=""/>
            </div>
            <div className="card__body">
                <h4>{nombre}</h4>
                <p>{puesto} y equipo {equipo}</p>
            </div>
        </article>
    )
}
export default CardEquipoEjemplo
